window.bookSummaryJSON = "<p><b>King Arthur....in outer space?</b></p> <p>Endless warfare has ravaged Earth. Billions are desperate to escape.</p> <p>Driven from her home and severed from her children, Taylan Ellis enlists with the Britannic Alliance, hoping she can help regain her homeland and find her kids.</p> <p>Her ship, the Valiant, picks up a distress signal that leads to the mummified remains of a Dark Ages warrior chieftain.</p> <p>Then, her commanding officer discovers the 'mummy' has a pulse.</p> <p>Taylan suspects she knows who the mystery man is, but can she convince her superiors in time to save the BA, her country, and her children?</p> <p>Download books one through three of the epic space fantasy adventure Star Legend today!</p>"; 
